        <p className='pi'>{`안무를 생성하고 있습니다. `}</p>
        <p
          className='pi'
       >{`음악 길이에 따라 소요 시간이 길어질 수 있습니다. `}</p>
     </b>
                    
                 
                        
                     
                        
    
      </section>
    );
  }
}
